import React from 'react';

export function Header () {
    return (
        <div class="header">
            <a href="/">design</a>
            <a id="nav-icon" href="/">Decoco</a>
            <a href="/">contact</a>
        </div>
    );
}

export function Footer () {
    return (
        <div class="footer">
            <a href="/">placeholder a</a>
            <a href="/">placeholder b</a>
            <a href="/">placeholder c</a>
        </div>
    );
}
